import React from "react";
import { InlineButton, RegularButton } from "./Button.css";

const Button = ({ type, children, ...props }) => {
  const Component = (() => {
    switch (type) {
      case "inline":
        return InlineButton;
      case "regular":
        return RegularButton;

      default:
        return RegularButton;
    }
  })();

  return <Component {...props}>{children}</Component>;
};
export default Button;
